// import React from "react";
import { useState } from "react";

isdone = true;

function Todo(props) {
   const [isdone,setisdone] = useState(false);


   function clicked(){
      setisdone(prevValue=>{
         return !prevValue;
      })
   }
   return( 
   <div onClick={clicked}>
   <li style={{ textDecoration: {isdone} === false ? "line-through" : null }}>{props.text}</li>
</div>
   )
}
export default Todo;
